import React from "react";

export default function Card({key,item}){
  let badgeText
  if(item.openSpots === 0){
    badgeText = "SOLD OUT"
  } else if(pitem.location === "Online"){
    badgeText="ONLINE"
  }

  console.log(pitem.location) 
  return(
    <div className="card">
      <img src={`../images/${pitem.img}`} className="card-image"/>
       {badgeText && <div className="sold">{badgeText}</div>}
      <div> 
        <img src="./images/star 1.png" width={14}/> {pitem.rating}  <span className="six">({pitem.reviewCount}).{pitem.location}</span>
      </div>
      
      <p className="life">
        {pitem.title}
      </p>
      <p className="lifes">
        <span className="from">From ${pitem.price}</span> / person
      </p>

    </div>
  )

}
